import React from "react";

const Dashboard = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient p-10">
      <h1 className="text-4xl font-bold text-white">Welcome to Your Dashboard</h1>
      <div className="mt-6 grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="bg-gray-800 p-6 rounded-lg shadow-lg text-center">
          <h3 className="text-xl font-semibold text-white">Interview History</h3>
          <p className="text-gray-400 mt-2">View and track past interviews.</p>
        </div>
        <div className="bg-gray-800 p-6 rounded-lg shadow-lg text-center">
          <h3 className="text-xl font-semibold text-white">Performance Analysis</h3>
          <p className="text-gray-400 mt-2">See your progress over time.</p>
        </div>
        <div className="bg-gray-800 p-6 rounded-lg shadow-lg text-center">
          <h3 className="text-xl font-semibold text-white">Upcoming Sessions</h3>
          <p className="text-gray-400 mt-2">Prepare for upcoming interviews.</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
